import React from "react";
import AlertWidgetSide from "../AlertWidgetSide";
import DashTileExpanded from "../../DashTileExpanded";
import DashboardMenuItem from "./DashboardMenuItem";


export default function DashboardSideNav(props){
    let dashboards = ['Market Overview', 'Dashboard 1', 'Dashboard 2'];
    menu = [];

    for (const [index, value] of dashboards.entries()) {
        menu.push(<DashboardMenuItem name={value}/>)
    }


    return(
        {menu}
    )




}
